import React from 'react';
import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
  const navigate = useNavigate(); // Continue using navigate for routing

  const handleButtonClick = () => {
    navigate('/form'); // Navigate to the form page
  };

  return (
    <div className="landing-container">
      <div className="logo-container">
        <img src="/_next/static/media/logo.04f3aa1e.png" alt="Lawroom AI" className="logo" />
        <p className="logo-text">Lawroom AI</p>
      </div>
      <h1>Welcome to Lawroom AI</h1>
      <button onClick={handleButtonClick} className="application-btn">
        Anticipatory Bail Application
      </button>
    </div>
  );
};

export default LandingPage;
